	 public static String processXMLForSpecialChar1(String inputXmlStr, String tagName, boolean isEscape){
		         
	        if(inputXmlStr == null || inputXmlStr.isEmpty())
				 return inputXmlStr;
			 
			 	Pattern regex = Pattern.compile("<(.*"+tagName+">)(.*?)</\\1",Pattern.DOTALL); 
		        Matcher matcher = regex.matcher(inputXmlStr);
		        StringBuffer outputStr=new StringBuffer();
		        
		        while (matcher.find()) {
		           if(isEscape){
		        	   System.out.println("MAtcher1:" + matcher.group(1));
		        	   System.out.println("MAtcher2:" + matcher.group(2));
		            	   //This will convert the special characters to their corresponding escape sequence.
		            	  matcher.appendReplacement(outputStr,"<"+matcher.group(1)+ StringEscapeUtils.escapeXml(Matcher.quoteReplacement(matcher.group(2)))+"</"+matcher.group(1));
		            } else{
		            	  //This will re-convert the escape sequence back to the corresponding character value.
		                  matcher.appendReplacement(outputStr,"<"+matcher.group(1)+ StringEscapeUtils.unescapeXml(Matcher.quoteReplacement(matcher.group(2)))+"</"+matcher.group(1));
		            }
		        }
		        //It collects the result in the StringBuffer.
		        matcher.appendTail(outputStr);
		        return outputStr.toString();
	  }
	 
