	public static String processXMLForSpecialChar(String inputXmlStr, String tagName, boolean isEscape){
		//String request = "<ApplyCnamRulesRequest><SiteCallingNm><>~-=!^?*?</SiteCallingNm><sb:SiteCallingNm>123<>~-=!^?*?</sb:SiteCallingNm></ApplyCnamRulesRequest>";
		System.out.println(inputXmlStr);
		Pattern regex = Pattern.compile("<(.*"+tagName+">)(.*?)</\\1",Pattern.DOTALL); 
		Matcher matcher = regex.matcher(inputXmlStr);
		StringBuffer outputStr=new StringBuffer();
		while (matcher.find()) {
			String tagName1 = matcher.group(1);
			String data = matcher.quoteReplacement(matcher.group(2));
			data = data.replaceAll("\\$", "\\$");
			System.out.println(tagName1+ " => " +StringEscapeUtils.escapeXml(data));
			if(isEscape)
				matcher.appendReplacement(outputStr,"<"+tagName1+ StringEscapeUtils.escapeXml(data)+"</"+tagName1);
			else
				matcher.appendReplacement(outputStr,"<"+tagName1+ StringEscapeUtils.unescapeXml(data)+"</"+tagName1);
			//String out = matcher.replaceFirst("<SiteCallingNm>"+StringEscapeUtils.escapeXml(matcher.group(1))+"</SiteCallingNm>");
			//System.out.println(out);
		}
		matcher.appendTail(outputStr);
//		System.out.println(outputStr);
		
		return outputStr.toString();
	}
	
	
